        height: '30vw',
        maxHeight: '800px',

        padding: '2vw',
    }

    const leftBlock = {
        width: '50%',
        height: '100%',
        borderRight: '1px solid #151C29'
    }

    const rightBlock = {
        width: '50%',
        height: '100%',
        display: 'flex',
        flexDirection: 'column',
    }

    const topBlock = {
        backgroundColor: 'red',
        display: 'flex',
        alignItems: 'center',
        height: '50%',
        margin: '0 0 10px 30px',
    }

    const bottomBlock = {
        backgroundColor: 'green',
        display: 'block',
        height: '50%',
        margin: '10px 0 0 30px',
    }

    const imgContTop = {
        background: `url('./images/jack.jpg')`,
        backgroundRepeat: 'no-repeat',
        backgroundSize: 'cover',
        display: 'block',
        height: '100%',
        width: '15vw',
        borderRadius: '50%',
    }

    const contTopDesc = {

    }

    const imgContBottom = {
        background: `url('./images/john.jpg')`,
        backgroundRepeat: 'no-repeat',
        backgroundSize: 'cover',
        display: 'block',
        height: '100%',
        width: '15vw',
        borderRadius: '50%',
    }

  return (
    <div className="contactSlip" style={ contactSlipCont }>
        <div style={ leftBlock }>
            Contact Us
        </div>
        <div style={ rightBlock }>
            <div style={ topBlock } className="bl">
                <div style={ imgContTop }></div>
                <div style={ contTopDesc }></div>
            </div>
            <div style={ bottomBlock }>
                <div style={ imgContBottom }></div>
                <div style={ contBottomDesc }></div>
            </div>
        </div>
    </div>
  );
}

export default ContactSlip;
